INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (42306, 3296, 'Danazol', 'Liver Diseases', 'The use of danazol is contraindicated in patients with severe hepatic impairment.  Danazol is metabolized by the liver to inactive forms.  Metabolic and therapeutic activity of danazol may be altered in patients with severe hepatic dysfunction.  Elevated serum transaminase levels, peliosis hepatis and benign hepatic adenoma have occurred during chronic administration of danazol.  Therapy with danazol should be administered cautiously in patients with or predisposed to hepatic dysfunction.', '3', '', 'DDInter', 0);
