INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (42326, 3296, 'Danazol', 'Thromboembolism', 'Danazol is contraindicated in patients with thrombosis or thromboembolic disease or a history of such events.  Thromboembolism, thrombotic and thrombophlebitic events, including fatal strokes, have occurred during danazol therapy.  Hematuria, menstrual spotting and thrombocytopenia have also occurred.  Additionally, therapy with danazol should be administered cautiously in patients with or predisposed to bleeding/clotting disorders.', '3', '', 'DDInter', 0);
