INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (42331, 3296, 'Danazol', 'Kidney Failure, Chronic', 'Danazol possess androgenic activity that can result in salt and water retention.  Danazol is eliminated by the kidney, and its use is contraindicated in patients with severe renal dysfunction.  It should also be administered cautiously in patients adversely affected by volume overload, such as patients suffering from epilepsy, diabetes mellitus, migraine, cardiac or renal dysfunction, polycythemia and hypertension.  These patients will require careful observation.', '3', '', 'DDInter', 0);
