INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (42336, 14119, 'Darifenacin', 'Gastrointestinal Diseases', 'Darifenacin is contraindicated in patients with gastric retention.  Darifenacin, like other anticholinergic drugs, may decrease gastrointestinal motility and should be used with caution in patients with gastrointestinal obstructive disorders and conditions such as severe constipation, ulcerative colitis, and myasthenia gravis because of the risk of gastric retention.', '3', '', 'DDInter', 0);
