INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (42354, 14119, 'Darifenacin', 'Central Nervous System Diseases', 'Darifenacin is associated with anticholinergic central nervous system (CNS) effects.  Patients should be monitored for signs of anticholinergic CNS effects, particularly after the initiation of treatment or if the dose is increased.  It is recommended to reduce the dose or discontinue treatment if patients experience anticholinergic CNS effects.  Care should be exercised when prescribing this agent to patients presenting headache, confusion, hallucinations, or somnolence as these might worsen with the use of darifenacin.', '2', '', 'DDInter', 0);
