INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (42359, 19403, 'Darifenacin', 'Central Nervous System Diseases', 'Darifenacin is associated with anticholinergic central nervous system (CNS) effects.  Patients should be monitored for signs of anticholinergic CNS effects, particularly after the initiation of treatment or if the dose is increased.  It is recommended to reduce the dose or discontinue treatment if patients experience anticholinergic CNS effects.  Care should be exercised when prescribing this agent to patients presenting headache, confusion, hallucinations, or somnolence as these might worsen with the use of darifenacin.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (42360, 14119, 'Darifenacin', 'Liver Diseases', 'Darifenacin is extensively metabolized by the liver following oral dosing.  The daily dose of darifenacin should not exceed 7.5 mg for patients with moderate hepatic impairment (Child-Pugh B).  Darifenacin has not been studied in patients with severe hepatic impairment (Child-Pugh C) and therefore is not recommended for use in this patient population.  No dose adjustment is recommended for patients with mild hepatic impairment (Child-Pugh A).', '2', '', 'DDInter', 0);
