INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (42390, 5848, 'Dasatinib', 'Pulmonary Arterial Hypertension', 'Dasatinib can increase the risk of developing pulmonary arterial hypertension (PAH) which may occur any time after treatment initiation, including after more than 1 year of treatment.  Manifestations may include dyspnea, fatigue, hypoxia, and fluid retention.  PAH may be reversible with treatment discontinuation.  Caution should be exercised in patients with underlying cardiopulmonary disease.  If PAH develops, treatment should be discontinued.', '2', '', 'DDInter', 0);
